import React from 'react';


const About = () => {
    return (
        <>
            <div className='container'>
                <div className='row'>
                    <div className='col-md-12'>
                        <div className='width-large-70'>
                            <h1>
                                About<br/>
                                Association of Civil Engineers<br/>

                            </h1>
                        </div>
                    </div>
                </div>
            </div>
        </>
    )
}

export default About;
